import React from "react";
const Navbar = ({setToken}) =>{

    return(
        <nav className='flex justify-around shadow-sm px-2 py-4'>
            <div>
            LOGO
            </div>
            <div className='flex gap-4'>
            <button className='px-2 py-1 font-semibold text-sm bg-red-500 text-white rounded shadow-sm' onClick={()=>{setToken('')}}>Logout</button>
            </div>
        </nav>
    );
}

export default Navbar;
